import React from 'react';
import { Switch, Router } from "react-router-dom";
import './App.css';
import HomePage from './pages/homepage.components'



function App() {
  return (
    <div>
      <Switch>
        <Route exact path="/" component={ HomePage } />

      </Switch>
      <HomePage />
    </div>
  );
}

export default App;
